new Listener(){
  @Override public void connected(  Connection connection){
    Connect c=new Connect();
    c.id=connection.getID();
    c.addressTCP=connection.getRemoteAddressTCP().toString();
    try {
      Net.handleServerReceived(c,c.id);
      connections.add(c.id);
    }
 catch (    Exception e) {
      Gdx.app.postRunnable(() -> {
        throw new RuntimeException(e);
      }
);
    }
  }
  @Override public void disconnected(  Connection connection){
    connections.removeValue(connection.getID());
    Disconnect c=new Disconnect();
    c.id=connection.getID();
    try {
      Net.handleServerReceived(c,c.id);
    }
 catch (    Exception e) {
      Gdx.app.postRunnable(() -> {
        throw new RuntimeException(e);
      }
);
    }
  }
  @Override public void received(  Connection connection,  Object object){
    if (object instanceof FrameworkMessage)     return;
    try {
      Net.handleServerReceived(object,connection.getID());
    }
 catch (    Exception e) {
      e.printStackTrace();
    }
  }
}
